import React, { useEffect, useState } from 'react';

function AIVisual() {
  const [activeMetric, setActiveMetric] = useState(0);

  useEffect(() => {
    const timer = setInterval(() => {
      setActiveMetric((prev) => (prev + 1) % 4);
    }, 3000);
    return () => clearInterval(timer);
  }, []);

  return (
    <div className="visual-container" style={{
      position: 'relative',
      width: '600px',
      height: '600px',
      background: 'linear-gradient(145deg, #111827, #1F2937)',
      borderRadius: '30px',
      padding: '30px',
      display: 'flex',
      flexDirection: 'column',
      gap: '25px',
    }}>
      {/* Main Visualization Area */}
      <div style={{
        flex: 1,
        position: 'relative',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
      }}>
        {/* Circular Progress and Data Points */}
        <div style={{
          position: 'relative',
          width: '400px',
          height: '400px',
        }}>
          {/* Rotating Outer Ring */}
          <div style={{
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            border: '2px solid rgba(59, 130, 246, 0.1)',
            borderRadius: '50%',
            animation: 'rotate 20s linear infinite',
          }} />

          {/* Data Points */}
          {Array.from({ length: 12 }).map((_, index) => {
            const angle = (index * 30) * (Math.PI / 180);
            const radius = 180;
            const x = Math.cos(angle) * radius;
            const y = Math.sin(angle) * radius;

            return (
              <div
                key={index}
                style={{
                  position: 'absolute',
                  top: '50%',
                  left: '50%',
                  transform: `translate(${x}px, ${y}px)`,
                  width: '12px',
                  height: '12px',
                  backgroundColor: '#3B82F6',
                  borderRadius: '50%',
                  animation: `pulse ${2 + Math.random()}s infinite ${Math.random()}s`,
                }}
              />
            );
          })}

          {/* Central Display */}
          <div style={{
            position: 'absolute',
            top: '50%',
            left: '50%',
            transform: 'translate(-50%, -50%)',
            width: '200px',
            height: '200px',
            backgroundColor: 'rgba(59, 130, 246, 0.1)',
            borderRadius: '50%',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            flexDirection: 'column',
            border: '2px solid rgba(59, 130, 246, 0.2)',
          }}>
            <div style={{
              fontSize: '36px',
              fontWeight: 'bold',
              color: '#3B82F6',
              marginBottom: '5px',
            }}>
              {['98%', '0.94', '2.3x', '86%'][activeMetric]}
            </div>
            <div style={{
              fontSize: '14px',
              color: '#9CA3AF',
            }}>
              {['Accuracy', 'F1 Score', 'Improvement', 'Confidence'][activeMetric]}
            </div>
          </div>

          {/* Connecting Lines */}
          <svg
            style={{
              position: 'absolute',
              top: 0,
              left: 0,
              width: '100%',
              height: '100%',
              transform: 'rotate(45deg)',
            }}
          >
            {Array.from({ length: 6 }).map((_, index) => (
              <line
                key={index}
                x1="200"
                y1="200"
                x2={200 + Math.cos(index * Math.PI / 3) * 180}
                y2={200 + Math.sin(index * Math.PI / 3) * 180}
                stroke="#3B82F6"
                strokeWidth="1"
                strokeOpacity="0.2"
                strokeDasharray="4"
              >
                <animate
                  attributeName="strokeOpacity"
                  values="0.2;0.4;0.2"
                  dur="3s"
                  repeatCount="indefinite"
                />
              </line>
            ))}
          </svg>
        </div>
      </div>

      {/* Metrics Row */}
      <div style={{
        display: 'grid',
        gridTemplateColumns: 'repeat(4, 1fr)',
        gap: '15px',
      }}>
        {[
          { label: 'Training', value: '96.8%' },
          { label: 'Validation', value: '94.2%' },
          { label: 'Testing', value: '93.7%' },
          { label: 'Loss', value: '0.042' },
        ].map((metric, index) => (
          <div
            key={index}
            style={{
              backgroundColor: 'rgba(59, 130, 246, 0.1)',
              padding: '15px',
              borderRadius: '15px',
              border: '1px solid rgba(59, 130, 246, 0.2)',
              textAlign: 'center',
            }}
          >
            <div style={{ color: '#9CA3AF', fontSize: '12px', marginBottom: '5px' }}>
              {metric.label}
            </div>
            <div style={{ color: '#FFFFFF', fontSize: '18px', fontWeight: 'bold' }}>
              {metric.value}
            </div>
          </div>
        ))}
      </div>

      {/* Progress Bars */}
      <div style={{
        display: 'flex',
        flexDirection: 'column',
        gap: '10px',
      }}>
        {[
          { label: 'Model Training', progress: 92 },
          { label: 'Data Processing', progress: 88 },
          { label: 'Feature Engineering', progress: 76 },
        ].map((item, index) => (
          <div key={index} style={{ display: 'flex', alignItems: 'center', gap: '15px' }}>
            <div style={{ color: '#9CA3AF', width: '120px', fontSize: '14px' }}>
              {item.label}
            </div>
            <div style={{
              flex: 1,
              height: '6px',
              backgroundColor: 'rgba(59, 130, 246, 0.1)',
              borderRadius: '3px',
              overflow: 'hidden',
            }}>
              <div
                style={{
                  width: `${item.progress}%`,
                  height: '100%',
                  backgroundColor: '#3B82F6',
                  borderRadius: '3px',
                  animation: 'progressGrow 1s ease-out',
                }}
              />
            </div>
            <div style={{ color: '#FFFFFF', width: '40px', fontSize: '14px' }}>
              {item.progress}%
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default AIVisual;
